import React from 'react'

function UsersDisplay(props) {
    const {users} = props
    console.log(users)
  return (
    <>
     <div className="wrap">
        {users?.map((item, index)=> (
            <div  className="box" >
            <div className="innerBox">
                <img src={item.urls.large} alt=""/>

            </div>     
        </div>
        ))}

    </div>
    </>
  )
}

export default UsersDisplay
